import React from "react";
import {Link} from "react-scroll";

 const Navbar =() => {
  
     return(

      <div className="Navbar">
       <Link
       activeClass="active"
       to ="Home"
       spy={true}
       smooth={true}
       offset={0}
       duration={500}
       >
       Home
       </Link>
       <Link
       activeClass="active"
       to ="about"
       spy={true}
       smooth={true}
       offset={0}
       duration={500}
       >
       About
       </Link>
       </div>
     ) }
     
     
      
         
export default Navbar;
